def get_length_of_missing_array(array_of_arrays):
    if array_of_arrays is None or len(array_of_arrays) == 0:
        return 0
    result = []
    for i in array_of_arrays:
        if i is None or len(i) == 0:
            return 0
        result.append(len(i))
    for n in range(min(result), max(result)+1):
        if n not in result:
            return n
    return 0

